import React from "react";
import Homepage from "./components/HomePage/Homepage";
import VideoPage from "./components/VideoPage/VideoPage";

import IntegrationSection from "./components/IntegrationSection/IntegrationSection";
import Group from "./components/Group/Group";
import VideoContainer from "./components/VideoContainer/VideoContainer";

import StoreDataModel from "./components/StoreDataModel/StoreDataModel";
// import Footer from "./components/Footer/Footer";
// import Footer from "./components/Footer/Footer";
import SellBetter from "./components/SellBetter/SellBetter";
import SuperChargeSection from "./components/SuperChargeSection/SuperChargeSection";
import MultiPlatform from "./components/MultiPlatform/MultiPlatform";
import MediaMagical from "./components/MediaMagical/MediaMagical";
import Library from "./components/Library/Library";
import HowItWorks from "./components/HowItWorks/HowItWorks";
import FeaturesGrid from "./components/FeaturesGrid/FeaturesGrid";
import Footer from "./components/Footer/Footer";

const App = () => {
  return (
    <div>
      <Homepage />
      {/* <VideoPage /> */}
      <IntegrationSection />
      {/* <Group /> */}
      {/* <VideoContainer /> */}
      <Library />
      <SuperChargeSection />
      <StoreDataModel />
      <SellBetter />
      <MultiPlatform />
      <MediaMagical />
      <HowItWorks/>
      <FeaturesGrid/>
      <Footer />
    </div>
  );
};

export default App;
